        public static void SendLoginReply(SOEClient soeClient)
        {
            var loginReply = new SOEWriter(ClientGatewayBasePackets.PacketLoginReply, true);

            loginReply.AddBoolean(true);

            var rawBytes = loginReply.GetRaw();

            var tunneledClient = new SOEWriter(ClientGatewayBasePackets.PacketTunneledClientPacket, true);

            tunneledClient.AddBoolean(true);
            tunneledClient.AddHostUInt32((uint)rawBytes.Length);

            tunneledClient.AddBytes(rawBytes);

            soeClient.SendMessage(tunneledClient.GetFinalSOEMessage(soeClient));
        }

        public static void ClientUpdatePacketDoneSendingPreloadCharacters(SOEClient soeClient)
        {
            var baseClientUpdate = new SOEWriter((ushort)BasePackets.BaseClientUpdatePacket, true);

            baseClientUpdate.AddHostUInt16((ushort)BasePackets.BaseClientUpdatePackets.ClientUpdatePacketDoneSendingPreloadCharacters);

            baseClientUpdate.AddBoolean(false);

            var rawBytes = baseClientUpdate.GetRaw();

            var tunneledClient = new SOEWriter((ushort)ClientGatewayBasePackets.PacketTunneledClientPacket, true);

            tunneledClient.AddBoolean(true);
            tunneledClient.AddHostUInt32((uint)rawBytes.Length);

            tunneledClient.AddBytes(rawBytes);

            soeClient.SendMessage(tunneledClient.GetFinalSOEMessage(soeClient));
        }

        public static void SendEncounterOverworldCombat(SOEClient soeClient)
        {
            var baseEncounter = new SOEWriter(BasePackets.BaseEncounterPacket, true);

            baseEncounter.AddHostUInt16(BasePackets.BaseEncounterPackets.EncounterOverworldCombatPacket);

            baseEncounter.AddHostUInt32(0);
            baseEncounter.AddHostUInt32(0);
            baseEncounter.AddBoolean(true);

            var rawBytes = baseEncounter.GetRaw();

            var tunneledClient = new SOEWriter(ClientGatewayBasePackets.PacketTunneledClientPacket, true);

            tunneledClient.AddBoolean(true);
            tunneledClient.AddHostUInt32((uint)rawBytes.Length);

            tunneledClient.AddBytes(rawBytes);

            soeClient.SendMessage(tunneledClient.GetFinalSOEMessage(soeClient));
        }

